<script type="text/javascript">
	setInterval(function () {
		var clock = document.getElementById('klokke');
		var time = new Date();
		var hours = time.getHours();
		if (hours < 10)
			hours = '0' + hours;
		var minutes = time.getMinutes();
		if (minutes < 10)
			minutes = '0' + minutes;
		var seconds = time.getSeconds();
		if (seconds < 10)
			seconds = '0' + seconds;
		clock.innerHTML = hours + ':' + minutes + ':' + seconds;
	}, 1000);
	if (window.location.hash) {
		document.getElementById('tittel').innerHTML = window.location.hash.substring(1);
	} else {
		alert('Open this page and append #ChannelName at the end of the URL');
	}
</script>
